                        "Desc": "使用梅洛彼得堡特制的泡泡枪，吹出既可以刺激血液循环、也可以让病人安心入睡的<color style='color:#FFD780;'>激愈水球</color>。<br>激愈水球将在附近的敌人间弹跳，命中敌人时基于希格雯的生命值上限，造成<color style='color:#80C0FF;'>水元素伤害</color>；弹跳时，为队伍中附近除希格雯自己外的所有角色恢复生命值，回复量受益于希格雯自己的生命值上限。<br>进行5次弹跳后，激愈水球将消失，并基于希格雯的生命值上限为她恢复生命值。<br>没有敌人时，激愈水球将在附近进行弹跳。至多同时存在一个希格雯自己创造的激愈水球。<br>长按时，能蓄力施放激愈水球。<br><br><color style='color:#FFD780;'>长按</color><br>进行瞄准蓄力，吹出更大更厉害的激愈水球！<br>激愈水球将随长按时间变大，至多变大二级，每级将使造成的伤害提升5%，回复量提升5%；弹跳后将变小一个等级，直到恢复为正常的激愈水球。<br>较弱的敌人被较大的激愈水球命中后会被禁锢，无法行动。<br><br>此外，施放时将在希格雯附近产生2枚源水之滴。每拾取一枚源水之滴，都会为希格雯自己赋予生命值上限10%的生命之契。<br>希格雯的生命之契被清除时，每清除2000点生命之契将为她恢复1点元素能量，至多通过这种方式为希格雯自己恢复5点元素能量。<br><br><color style='color:#FFD780;'>始基力：荒性</color><br>每隔一段时间，激愈水球将在命中的位置降下流涌之刃，基于希格雯的生命值上限，造成具有荒性的<color style='color:#80C0FF;'>水元素伤害</color>。<br><br><i>「怎么样，用这样的水疗法，既能刺激循环，又能让复健的病人感受到乐趣，而且，也会让应该睡着的病人好好睡一会儿呢…」</i>",
